To achieve this, you can use a `sap.m.Page` as a container for your dialog and table. When the full screen button is clicked, you can use JavaScript to toggle a CSS class that sets the table to occupy the full screen size. Here's an example code to demonstrate this:

```xml
<mvc:View
    controllerName="yourController"
    xmlns="sap.m"
    xmlns:l="sap.ui.layout"
    xmlns:mvc="sap.ui.core.mvc">
    <Page title="Full Screen Table Dialog">
        <content>
            <Button text="Open Dialog" press="onOpenDialogPress"/>
        </content>
    </Page>
</mvc:View>
```

In the controller file:

```javascript
sap.ui.define([
   "sap/ui/core/mvc/Controller",
   "sap/m/Dialog",
   "sap/m/Table",
   "sap/m/Button",
   "sap/m/Text",
   "sap/m/Column",
   "sap/m/ColumnListItem"
], function (Controller, Dialog, Table, Button, Text, Column, ColumnListItem) {
   "use strict";

   return Controller.extend("yourController", {
      onInit: function () {
         this.oDialog = new Dialog({
            title: "Table Dialog",
            contentWidth: "50%",
            content: new Table({
               columns: [
                  new Column({ header: new Text({ text: "Column 1" }) })
               ],
               items: [
                  new ColumnListItem({ cells: [new Text({ text: "Item 1" })] })
               ]
            }),
            buttons: [
               new Button({
                  text: "Full Screen",
                  press: this.onFullScreenPress.bind(this)
               }),
               new Button({
                  text: "Close",
                  press: this.onCloseDialogPress.bind(this)
               })
            ]
         });

         this.getView().addDependent(this.oDialog);
      },

      onOpenDialogPress: function () {
         this.oDialog.open();
      },

      onFullScreenPress: function () {
         var oTable = this.oDialog.getContent()[0];
         oTable.toggleStyleClass("fullScreenTable");

         var bFullScreen = oTable.hasStyleClass("fullScreenTable");
         this.oDialog.setContentWidth(bFullScreen ? "100%" : "50%");
      },

      onCloseDialogPress: function () {
         this.oDialog.close();
      }
   });
});
```

